import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';

const PageOne = () => {
    return (
        <div>
            Page 111111
            <Link to='/pagetwo' />
        </div>
    );
};

const PageTwo = () => {
    return <div>Page 222222</div>;
};

const App = () => {
    return (
        <div>
            <BrowserRouter>
                <div>
                    <Route path='/' exact component={PageOne} />
                    <Route path='/pagetwo' component={PageTwo} />
                </div>
            </BrowserRouter>
        </div>
    );
};

export default App;
